window.bookSummaryJSON = "<p>Are the kids asleep? Yes? Good. This one isn’t for them. Now, if your weary, grown-up mind has been searching for a snarkier alternative to your favorite childhood tales, this Audible Original, hosted by Nick Offerman (<i>Parks &amp; Recreation</i>), will scratch that itch - and then some. Enjoy a hilarious collection of short stories, featuring performances from the likes of Tommy Chong (Cheech &amp; Chong), Tony Hale (<i>Veep</i>), Patton Oswalt (<i>The Goldbergs</i>), and David Spade (<i>Saturday Night Live</i>).&nbsp;</p> <p><b><i>Contains explicit content.</i></b></p>"; 
